import { createAnimatedOperator } from './core/AnimatedOperator';
var operator = createAnimatedOperator;
export var add = operator('add');
export var sub = operator('sub');
export var multiply = operator('multiply');
export var divide = operator('divide');
export var pow = operator('pow');
export var modulo = operator('modulo');
export var sqrt = operator('sqrt');
export var log = operator('log');
export var sin = operator('sin');
export var cos = operator('cos');
export var exp = operator('exp');
export var round = operator('round');
export var lessThan = operator('lessThan');
export var eq = operator('eq');
export var greaterThan = operator('greaterThan');
export var lessOrEq = operator('lessOrEq');
export var greaterOrEq = operator('greaterOrEq');
export var neq = operator('neq');
export var and = operator('and');
export var or = operator('or');
export var defined = operator('defined');
export var not = operator('not');
export var tan = operator('tan');
export var acos = operator('acos');
export var asin = operator('asin');
export var atan = operator('atan');
export var abs = operator('abs');
export var ceil = operator('ceil');
export var floor = operator('floor');
export var max = operator('max');
export var min = operator('min');
